      .then(response => response.json())
      .then(data => {
        console.log(data.photos);
        data = data.photos;
        setBackendData(data);
      });
  }, []);
  return (
    <div>
      {backendData}
      hello
      <div>
        {" "}
        {backendData.map(backend => (
          <div>{backend.id}</div>
        ))}
      </div>
    </div>
  );
}

